fun maxVowels(s: String, k: Int): Int {
    val test = arrayOf("u", "e", "o", "a", "i")
    var maxNumb = 0
    var tmpNumb = 0
    for (i in k..s.length) {
        if (i == k) {
            for (e in s.substring(0, k)) if (test.contains(e.toString())) tmpNumb++
        } else {
            if (test.contains(s[i - k - 1].toString())) tmpNumb--
            if (test.contains(s[i - 1].toString())) tmpNumb++
        }
        if (tmpNumb >= maxNumb) maxNumb = tmpNumb
    }
    return maxNumb
}